import React from "react";

import Points from "./Points";

import "./Features.css";

import pixel from "../../assets/pixel.png";

const Features = () => {
  return (
    <div id="features">
      <img src={pixel} alt="pixel" className="pixel" />
      <div className="features-heading">
        <h2>All information that you need</h2>
        <h2>in your pocket</h2>
      </div>
      <div>
        <span>Notification system</span>
        <br />
        <span>You can filter types of hazards to detect</span>
        <br />
        <span>You can filter</span>
      </div>
      {/*<Points />*/}
    </div>
  );
};

export default Features;
